import 'package:flutter/material.dart';
import 'package:tts09b/reuseable_widgets.dart';

class ResueableExample extends StatefulWidget {
  const ResueableExample({super.key});

  @override
  State<ResueableExample> createState() => _ResueableExampleState();
}

class _ResueableExampleState extends State<ResueableExample> {


  List name = ["Abdul Rehman", "Muhammad", "Taha", "Ali", "Azfar", "Azeem"];
  List images = ["", "", ""];

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      body: ListView.builder(
        itemCount: name.length,
          itemBuilder: (context, index) {
            return Abc(text: "${name[index]}", containerImage: "data:image/jpeg;base64,");
          },)
    );
  }
}





